DROP TABLE IF EXISTS `items`;
CREATE TABLE `items` (
  `id` bigint(20) unsigned NOT NULL auto_increment,
  `parent_id` bigint(20) unsigned NOT NULL default '0',
  `item_family` int(11) unsigned default '5',
  `item_type` int(11) unsigned NOT NULL default '1',
  `privateowner_id` bigint(20) unsigned NOT NULL default '0',
  `oX` float NOT NULL default '0',
  `oY` float NOT NULL default '0',
  `oZ` float NOT NULL default '0',
  `oW` float NOT NULL default '0',
  `x` float NOT NULL default '0',
  `y` float NOT NULL default '0',
  `z` float NOT NULL default '0',
  `planet_id` int(2) NOT NULL default '0',
  `customName` char(255) default NULL,
  `maxCondition` int(11) unsigned NOT NULL default '100',
  `damage` int(11) unsigned NOT NULL default '0',
  `dynamicInt32` int(11) unsigned NOT NULL default '0',
  PRIMARY KEY  (`id`),
  KEY `fk_items_family` (`item_family`),
  KEY `fk_items_item_type` (`item_type`),
  CONSTRAINT `fk_items_family` FOREIGN KEY (`item_family`) REFERENCES `item_families` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_items_item_type` FOREIGN KEY (`item_type`) REFERENCES `item_types` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=281474976710665 DEFAULT CHARSET=utf8 ROW_FORMAT=REDUNDANT;

